      "title": "湾区探店之二刷MTV downtown包大人",
      "desc": "马兰头，总体还行有点干，但感觉比小时候吃的总是少点啥味儿。\n点了蟹粉小笼，比上次普通的好吃，关键这次终于咸一点了[吐舌头H] 看得到里面晃动的汤汁，干掉人家大半瓶醋[害羞R]\n生煎馒头感觉肉没上次新鲜，皮有点一言难尽。又不是很爱了……以后要不就只吃小笼好了。\n旁边的老外一个劲的感叹哇，好好吃，我以前在中国吃过念念不忘终于又吃到了……[石化R]\n好想回上海[哭惹R][哭惹R][哭惹R]\n#湾区生活[话题]# #湾区[话题]# #湾区美食[话题]# #加州生活[话题]# #food[话题]# #湾区探店[话题]# #小笼包[话题]# #生煎馒头[话题]# #山景城美食[话题]# #美食探店[话题]#",
